import React from "react";
import "./countryBadge.css";

function CountryBadge({ country }) {
  const url = `/events/mentions/${country}`;
  return (
    <a href={url}>
      <span className="badge country-badge m-1">{country}</span>
    </a>
  );
}

export default CountryBadge;
